text:
President Trump formally began U.S. withdrawal from the Paris Climate Accords.

@HouseDemocrats passed H.R. 9, a bill to honor our agreement and lay the groundwork for further climate action. 

We will continue to act as the White House refuses to acknowledge climate change.

Climate change is a reality. Period.

Pulling the U.S. out of the #ParisAgreement is not only a blatant refusal to participate in a necessary global fight against climate change, but it threatens ALL life across the world. 

@realDonaldTrump, you're a failure. https://t.co/XuzFXursf6 https://t.co/4YXYEeQrSQ
